import React from 'react';

import AddEmployeeModal from './addEmployeeModal.jsx';

const ModalConductor = props => {
  switch (props.currentModal) {
    case 'ADD_EMPLOYEE':
      return <AddEmployeeModal {...props} show = 'true' />;
    default:
      return null;
  }
};

export default ModalConductor;
